import React from 'react';
import ComponentNavbar from './components/layouts/navbar';
import { BrowserRouter } from 'react-router-dom';

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <div className="App">
          <ComponentNavbar />
          <h1>Hello Devs!</h1>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
